import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './CSS/Menu.css';

const Menu = () => {
    const navigate = useNavigate();

    // Check if user is logged in
    useEffect(() => {
        const token = localStorage.getItem('authToken');
        if (!token) {
            // Redirect to log in if not authenticated
            navigate('/login');
        }
    }, [navigate]);


    return (
        <div>
        <div className="flex">
            <div className="w-1/2">
                <h1 className="font-sf font-bold text-6xl style={{ backgroundImage: 'url(/images/menubg.jpg)' }}">
                    Browse through our cuisine to find the perfect dish for yourself.
                </h1>
            </div>
            <div className="w-1/2"></div>
        </div>

            <div>Indian Food</div>
        </div>


    );
};

export default Menu;
